import {useDispatch} from 'react-redux';
import { testReducer } from '../../redux/reducers/testSlice';
const Header = () => {
    const dispatch = useDispatch();
    const testHandle = () => {
        dispatch( testReducer );
    }
    return(
        <header><button onClick={testHandle}>Test</button></header>
    )
}
export default Header;
